{'pk': 18148209151074471, 'user_id': 4083812226, 'text': 'Nos vemos en un rato en la presentación de Un horizonte vertical, de Catalina Fara ❤️ La cita las 18 horas, por Zoom (el link está en nuestra bio). No hace falta inscripción previa.

Participan la autora, la Arq. Silvia Dócola (Universidad Nacional de Rosario) y la Dra. Inés Yujnovsky (Universidad Nacional de San Martín).

