{'pk': 17866791158046873, 'user_id': 4083812226, 'text': 'Una de las cosas que más extrañamos son los eventos que hacíamos antes de todo esto. Nueva normalidad mediante, la semana que viene tendremos la primera presentación pandémica de un libro en la historia de Ampersand: Un horizonte vertical, de Catalina Fara. Junto con @centrociap los invitamos este martes 22 a las 18h, por Zoom (les dejamos el link en la bio), al evento en el cual la Arq. Silvia Dócola (UNR) y la Dra. Inés Yudnovsky (Unsam) presentarán el libro y dialogarán con su autora. La actividad es gratuita y no requiere inscripción previa. Por consultas, pueden comunicarse a ciap@unsam.edu.ar

Preparen sus cámaras. ¡Nos vemos!

