{'pk': 17872526401916221, 'user_id': 4083812226, 'text': '"Creo que lo que a mí me atrajo desde chica de leer poesía fue justamente ese murmullo que segregan las historias cuando se suspenden y se retoman desde un ritmo que se escucha cerca, íntimamente. En esa voz que devuelve la historia a la lectura al mismo tiempo que la abandona, lo que se escucha es siempre el estribillo. Casi diría que leer para mí es leer estribillos".

Libros chiquitos, de Tamara Kamenszain. La foto, muy contextual, es de @dylan.libros 

