{'pk': 17852180672235705, 'user_id': 4083812226, 'text': 'Nuestra colección Comunicación & Lenguajes, dirigida por Silvia Ramírez Gelbes, se propone abordar los cambios en la producción y recepción de mensajes en la sociedad hipermediatizada en la que vivimos, así como en los medios y lenguajes que utilizamos para ello, y reflexionar sobre estas cuestiones a partir de investigaciones rigurosas en las áreas de la comunicación, la traducción y la lingüística sin dejar de lado sus implicancias en la política, el nuevo mapa de los medios y los avances de la tecnología.

¿Cuál(es) ya leyeron? ¿Tienen alguno en la pila de pendientes?

