{'pk': 18077243818210088, 'user_id': 4083812226, 'text': '"Leer no es solo una pasión de la imaginación: es una práctica diaria, un trabajo, una misión, una militancia, un ritual de burócrata, un tratamiento, una disciplina, una fe, una costumbre, un pecado, una inversión, un compromiso, una deuda, un hobby, una droga –todo al mismo tiempo, todo el tiempo" - Trance, Alan Pauls

Hoy es nuestra efeméride preferida de todo el año: feliz día del lector para todos y todas. Ojalá lo pasemos haciendo lo que más nos gusta.

