{'pk': 17958349081335934, 'user_id': 4083812226, 'text': '“Desde el punto de vista del siglo XXI, nuestro propio libro códice está tan normalizado que a veces cuestionamos las propiedades de lo que ‘hace a un libro’ cuando algo afecta las expectativas que tenemos sobre nuestra experiencia de lectura sin darle demasiada importancia al hecho de que leer en una dirección en lugar de en otra, el hábito de leer un texto entre líneas en silencio y el de colocar el título y el nombre de un autor en la tapa de un libro son todos comportamientos adquiridos”.

El libro expandido, de Amaranth Borsuk. Si ya lo leyeron o están en eso, esperamos sus reseñas siempre 🧡.

