{'pk': 17894834674566325, 'user_id': 4083812226, 'text': 'Día 2 la @feriadeeditores: 10% de descuento en nuestro catálogo si lo consiguen en @libreria.norte, más envío gratis en CABA ❤️. De 18 a 20 h estamos conectados para hablar del catálogo con ustedes por Instagram y WhatsApp.

Además, hoy a las 19 h van a poder ver Anatomía de un libro: una diálogo con Amaranth Borsuk, autora de El libro expandido. Amaranth es poeta, artista conceptual, investigadora y docente, y hablamos con ella, además de su nuevo título (su primer trabajo que se traduce al español), del presente y el futuro el libro. Lo vamos a subir a historias de Instagram.

