{'pk': 18156555628004132, 'user_id': 4083812226, 'text': 'Nuestra colección Estudios de Moda busca llenar la ausencia de textos en español en el campo de los fashion studies. Ya tenemos tres títulos para entretenernos, y pronto vendrán más (pero de eso les contamos más adelante) ❤️. Los consiguen en la @feriadeeditores este fin de semana. Nos acompaña @libreria.norte

Los textos que integran la colección Estudios de Moda buscan considerar los aspectos materiales de la moda, las prácticas del vestir y sus sociabilidades, las relaciones con el cuerpo, con la sexualidad, con la política y su diálogo con la cultura visual y el ámbito literario. Al mismo tiempo, esta construcción de la apariencia tiene un fuerte correlato con la formación de la identidad y de las reflexiones ligadas con estos procesos. Es así que en esta colección la filosofía, la psicología, el arte, el cine, y la reflexión sobre la práctica específica del diseño de indumentaria encuentran su espacio.

