{'pk': 18064142374242204, 'user_id': 4083812226, 'text': 'Hoy aprovechamos un rayo de sol del mediodía para leer El libro expandido en el balcón, como si estuviésemos al aire libre. ¿Ustedes resignificaron algún lugar de sus casas como espacio de lectura? Los leemos en los comentarios 👀

“Nuestros tiempos se parecen mucho a los primeros siglos de los tipos móviles: marcan el inicio de un cambio. Tal como los libros manuscritos continuaron existiendo en los tiempos de Gutenberg, los libros ahora existen en formas múltiples y simultáneas: como libros en rústica, audiolibros, descargas EPUB y, raras veces, como experiencias digitales interactivas. Esas experiencias requieren una definición más amplia del libro. También ofrecen oportunidades para generar una nueva clase de atención que, aunque no reemplazará la ‘lectura profunda’, tiene una marcada espacialidad y materialidad, y nos lleva debajo de la superficie de la pantalla”. 

