{'pk': 18108549250153285, 'user_id': 4083812226, 'text': 'La semana que viene llega la edición virtual y pandémica de la @feriadeeditores  2020 y ahí vamos a estar 🙌🏻. Tres días para hacer, vivo de Instagram mediante, lo que más nos gusta: hablar de libros con ustedes. La librería que nos va a acompañar para que puedan conseguir nuestros títulos es @libreria.norte ❤️. Pueden ver toda la información logística de esta edición en la página de la FED (nosotros también vamos a ir contándoles sobre eso en los próximos días).
También tenemos nuestra próxima charla de La biblioteca secreta en el marco de la Feria, esta vez con Margo Glantz. Pueden verla el domingo 9/8 a las 21.30h por el canal de YouTube de la Feria de Editores.

