{'pk': 17860345547039149, 'user_id': 4083812226, 'text': '“La ubicuidad del libro como objeto de arte comercializable llevó al escritor y artista mexicano Ulises Carrión (1941-1989) a escribir en 1975: ‘Un libro puede ser el recipiente accidental de un texto cuya estructura es irrelevante al libro: son los libros de las librerías y las bibliotecas’. […] El análisis irónico del libro como objeto comercial por parte de Carrión refleja la separación de la forma y el contenido que percibía en la escritura y la publicación de la época. […] En parte, lo de Carrión era un llamamiento a que los autores estuvieran más atentos a la materialidad del libro y al impacto sobre el sentido, pero también era un pedido para romper con un sistema que privilegiaba la escritura como labor intelectual y denigraba el aspecto físico de la producción del libro”.

Fragmento de El libro expandido, de Amaranth Borsuk. El libro de artista y su manera de cuestionar el contenido a través de la forma es un elemento fundamental en el análisis que hace la autora para trazar la historia del libro y la experimentación con sus suportes. Aquí, el ejemplo de Ulises Carrión, precursor latinoamericano en ese ámbito.

