{'pk': 17881012618681871, 'user_id': 4083812226, 'text': 'Ya podemos agregar a la historia de Ampersand la primera novedad nacida en épocas de pandemia: El libro expandido, de Amaranth Borsuk, de la colección Comunicación & Lenguajes 🧡.

Los sentidos asociados al libro se expanden en esta historia excepcional. El libro como objeto, contenido, idea e interfaz son las cuatro etapas, sucesivas y dialécticas, a partir de las que la joven poeta, investigadora y artista conceptual aborda el devenir milenario del libro desde las primeras tablillas hasta la actualidad digital. Una investigación detallada desde los orígenes del códice pero con la atención puesta en el presente, los nuevos modos de lectura, las experimentaciones artísticas con soportes materiales y el concepto de libro como espacio de creatividad colectiva. Cultura escrita, comunicación y arte contemporáneo se potencian en El libro expandido y brindan una mirada de vanguardia sobre las transformaciones de una interfaz, el códice, que no deja de reeditarse y mutar.

Ya pueden conseguirlo en varias de nuestras librerías amigas (las encuentran mencionadas en historias), en los próximos días estará llegando a más!', 'type': 1, 'created_at': 1594843705, 'created_at_utc': 1594843705, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 4083812226, 'username': 'ediciones.ampersand', 'full_name': 'Ediciones Ampersand', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/15538196_749742211845830_654021002606411776_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IHUkSzlySDgAX8qSKE0&_nc_tp=25&oh=5a81338f8bdd3a66d9f7284ec6c97d75&oe=5FD59E25', 'profile_pic_id': '1410351090402281932_4083812226', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2354032071480994394, 'has_translation': True, 'private_reply_status': 0}

