{'pk': 17873719762530764, 'user_id': 4083812226, 'text': '"Alcott representa en los personajes de Jo y Laurie el género como algo fluido, algo que es necesario aprender pero que puede modificarse e incluso rechazarse hasta cierto punto. Jo no tiene ningún problema en ocultar su deseo de ser varón; a Laurie lo burlaban en la escuela (los varones lo llamaban Dora) y Jo no solo lo bautiza Laurie o Teddy, de manera afectuosa, sino que además está decidida a convertirlo en una de sus hermanas". Jo y Laurie, siguiendo lo que dice Anne Boyd Rioux en esta cita de El legado de Mujercitas, son personajes que marcaron un antes y un después en las representaciones y los estereotipos asociados al género en la literatura. También son,  definitivamente, una de las (no) parejas más famosas de la historia. Louisa May Alcott recibía miles de cartas de lectoras rogándole que terminasen casados al final de la novela, pero ella tenía otros planes para su protagonista. En la versión cinematográfica que se estrena esta semana, Jo y Laurie son interpretados por #SaoirseRonan y @tchalamet. 
Recuerden que seguimos con el sorteo de entradas, pueden encontrarlo un par de posteos más abajo.

