{'pk': 17844745138717306, 'user_id': 4083812226, 'text': 'Hoy hace un año tuvimos la visita de Valerie Steele, autora de Fashion Theory y referente de los estudios de moda, con su masterclass en @faducomunica y una charla abierta en @museomalba.

La semana pasada (inspirados en El estilo entre líneas, nuestro último título), organizamos las primeras Jornadas de Periodismo de Moda, en las que hablamos sobre el sistema de la moda y sus medios, además de sus cruces con el arte y el detrás de escena de cómo es hacer esas publicaciones hoy.

La colección Estudios de Moda busca llenar el vacío académico en relación al campo de la moda y seguir dando estos y muchos debates más. Gracias por acompañarnos en todos ellos ❤️ (Las fotos de los eventos de Valerie son de @josefinachevalier)', 'type': 1, 'created_at': 1570568519, 'created_at_utc': 1570568519, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 4083812226, 'username': 'ediciones.ampersand', 'full_name': 'Ediciones Ampersand', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/15538196_749742211845830_654021002606411776_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IHUkSzlySDgAX8qSKE0&_nc_tp=25&oh=5a81338f8bdd3a66d9f7284ec6c97d75&oe=5FD59E25', 'profile_pic_id': '1410351090402281932_4083812226', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2150407040407956078, 'has_translation': True, 'private_reply_status': 0}

