{'pk': 18104192977045649, 'user_id': 4083812226, 'text': 'Dado el éxito que está teniendo la convocatoria a las Jornadas de Periodismo de Moda, ambos días van a tener lugar en el auditorio de @museomalba. Tiene capacidad para más de 200 personas, para que todos los y las que quieran venir puedan acompañarnos.

Las entradas, libres y gratuitas, se entregarán en la boletería de Malba el mismo día del evento a partir de las 16h, por orden de llegada y hasta agotar capacidad de la sala, sin inscripción previa. Son válidas solamente para el día en curso.

Compartimos una vez más el programa con las charlas y los oradores. Atentos quienes quieran venir el jueves 3, porque hubo un cambio en los horarios en la segunda charla. ¡Los esperamos mañana!', 'type': 1, 'created_at': 1569937629, 'created_at_utc': 1569937629, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 4083812226, 'username': 'ediciones.ampersand', 'full_name': 'Ediciones Ampersand', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/15538196_749742211845830_654021002606411776_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IHUkSzlySDgAX8qSKE0&_nc_tp=25&oh=5a81338f8bdd3a66d9f7284ec6c97d75&oe=5FD59E25', 'profile_pic_id': '1410351090402281932_4083812226', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2145114088437470858, 'has_translation': True, 'private_reply_status': 0}

{'pk': 18074012110140665, 'user_id': 4083812226, 'text': 'Los editores y editoras siempre han sido el alma de las revistas sobre moda. Desde Sarah Josepha Hale en la Godey’s Lady’s Book de 1837, pasando por Bettina Ballard, Diana Vreeland y Carmel Snow hasta las más actuales, como Franca Sozzani y Anna Wintour, su mirada experta y sus criterios (estéticos, pero también prácticos y comerciales) fueron marcando maneras de concebir la moda (y cómo comunicarla).
En la charla “El ojo tiene que viajar. El periodismo de moda desde la mirada de sus editores”, el 2 de octubre a las 19.30h, tendremos a @derfernando @carolabirgin y @ceciconde hablando un poco más sobre esto desde su propia experiencia.

Las jornadas son libres y gratuitas. Las entradas para el evento se entregarán en la boletería de @museomalba el mismo día a partir de las 16h, por orden de llegada y hasta agotar capacidad de las salas, sin inscripción previa. Son válidas solamente para el día en curso.', 'type': 1, 'created_at': 1569852890, 'created_at_utc': 1569852890, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 4083812226, 'username': 'ediciones.ampersand', 'full_name': 'Ediciones Ampersand', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/15538196_749742211845830_654021002606411776_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IHUkSzlySDgAX8qSKE0&_nc_tp=25&oh=5a81338f8bdd3a66d9f7284ec6c97d75&oe=5FD59E25', 'profile_pic_id': '1410351090402281932_4083812226', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2144402115760697692, 'has_translation': True, 'private_reply_status': 0}

