{'pk': 17903418979324072, 'user_id': 4083812226, 'text': 'Hoy en la Universidad de Alcalá se presentaron La experiencia escrita, de Philippe Artières, e Imprentas nómadas, de Maria Gioia Tavoni y Alessandro Corubolo, el próximo título de nuestra colección Scripta Manent.

Estuvieron presentes Artières, Antonio Castillo Gómez (director de la colección) y Ana Mosqueda (nuestra directora editorial). En la presentación del nuevo título también participó Mercedes López Suárez.

