{'pk': 18024585004148615, 'user_id': 4083812226, 'text': 'Nuestra novedad de Abril ya está con nosotros: La experiencia escrita, de Philippe Artières.

Si algo debe hacer la historia, en palabras de Philippe Artières, es describir. Pero no buscando la objetividad, sino abordando el objeto de estudio desde su materialidad, su contexto de uso, las expectativas de su autor, la mirada de los futuros lectores. Desde una perspectiva arqueológica, que no desestima el lugar de la memoria y que hace honor a su rol como director del Instituto Michel Foucault, Artières analiza en este título el taller de escritura autobiográfica de un prisionero lionés a fines del siglo XIX, el sentido de las cartas anónimas, la representación de la escritura en un cuadro de Edgar Degas y las señales luminosas en las novelas de Patrick Modiano, entre muchas cosas más.

El lunes 22 llega a nuestras librerías de siempre.', 'type': 1, 'created_at': 1555445127, 'created_at_utc': 1555445127, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 4083812226, 'username': 'ediciones.ampersand', 'full_name': 'Ediciones Ampersand', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/15538196_749742211845830_654021002606411776_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IHUkSzlySDgAX8qSKE0&_nc_tp=25&oh=5a81338f8bdd3a66d9f7284ec6c97d75&oe=5FD59E25', 'profile_pic_id': '1410351090402281932_4083812226', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2023517767776513301, 'has_translation': True, 'private_reply_status': 0}

{'pk': 18030858685117130, 'user_id': 4083812226, 'text': '¡Recién nos llega de la imprenta! Historia natural y mítica de los elefantes, de José Emilio Burucúa y Nicolás Kwiatkowski, es el primer título de nuestra nueva colección, Fuera de Serie. Los autores recorren la mitología, la ciencia, la religión y el arte en busca de las representaciones que tuvo el elefante, desde la Antigüedad hasta la edad contemporánea.

Este miércoles 20 de marzo a las 18h tenemos la presentación del libro en el @museooriental. Además de Burucúa y Kwiatkowski, estarán Carlos Reboratti y @marina.rieznik.

También en el museo sigue la exhibición “Señor de las categorías creadas”, curada por los autores, que indaga sobre la figura del elefante en Asia (martes a domingos de 12.30 a 19h). ¡Los esperamos a todos!', 'type': 1, 'created_at': 1552943045, 'created_at_utc': 1552943045, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 4083812226, 'username': 'ediciones.ampersand', 'full_name': 'Ediciones Ampersand', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/15538196_749742211845830_654021002606411776_a.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=IHUkSzlySDgAX8qSKE0&_nc_tp=25&oh=5a81338f8bdd3a66d9f7284ec6c97d75&oe=5FD59E25', 'profile_pic_id': '1410351090402281932_4083812226', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 0, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2002553857636309052, 'has_translation': True, 'private_reply_status': 0}

{'pk': 18009453958165471, 'user_id': 4083812226, 'text': 'A partir de hoy y hasta el 24 de marzo pueden ver la exhibición “Señor de las categorías creadas”, curada por José Emilio Burucúa y Nicolás Kwiatkowski, autores de Historia natural y mítica del elefante, que organizamos junto con el @museooriental para acompañar el lanzamiento del libro. 
La muestra tiene tres ejes: el elefante en las grandes religiones de la India (hinduismo, budismo y jainismo), sus funciones ceremoniales (desfiles, actos, festividades) y en la guerra.

