{'pk': 17954489407230758, 'user_id': 4083812226, 'text': 'La colección Estudios de Moda surgió con la intención de llenar el vacío de material bibliográfico sobre fashion studies en español. También busca que podamos cuestionarnos sobre los aspectos materiales de la moda, las prácticas del vestir y sus sociabilidades, las relaciones con el cuerpo, con la sexualidad, con la política y su diálogo con la cultura visual y el ámbito literario.

Con estos dos primeros títulos ya tenemos para entretenernos por un rato. 
