{'pk': 18000382462004885, 'user_id': 4083812226, 'text': 'Seguimos con los viernes de novedades y sumamos un nuevo Lector: llegó El centro de la tierra, de Jorge Monteleone.

Para Monteleone la lectura tiene ritmo, imagen, movimiento. La biblioteca no es el templo sagrado de los conocimientos eruditos, sino celebración de los sentidos y de los afectos primarios: el recuerdo del padre, de la madre, la complicidad de dos niños, y la voz italiana de un abuelo comunista que enseña que la literatura no es propiedad sino “un invento y un robo”. El paraíso es la infancia que regresa en la lectura.

