{'pk': 17965059427166485, 'user_id': 4083812226, 'text': 'Cuando a Louisa May Alcott le encargaron que escriba una novela para niñas, no creyó poder hacerlo. “Nunca me cayeron bien las niñas; de hecho, nunca conocí a muchas tampoco, a excepción de mis hermanas”. Decidió basarse en su infancia juntas para escribir la historia, pensando que "nuestras peculiares obras de teatro y nuestras experiencias quizás puedan despertar algún interés". Así, Meg, Jo, Beth y Amy March son versiones de Anna, Louisa, Lizzie y May Alcott. "La familia patética", como ella misma llamaba a su familia, fue el primer título que le puso al manuscrito.
La primera parte de El legado de Mujercitas analiza en profundidad cómo la vida de Louisa influyó en la novela y, después, cómo la novela cambió la suya.

