{'pk': 17971115536082679, 'user_id': 4083812226, 'text': 'Aunque Coco Chanel no fue la primera mujer diseñadora, es sin duda la mujer más famosa en la historia de la moda. Su verdadero legado no pasa por haber “inventado” hitos como el vestidito negro, el perfume de diseñador o los pantalones para mujeres (todo eso ya existía), sino por redefinir el concepto de elegancia: una elegancia disciplinada, refinada y austera, opuesta al lujo tradicional, anticuado y ostentoso. Solo una sensibilidad moderna y sofisticada era capaz de advertir que menos, en realidad, era más. 
El capítulo 4 de Fashion Theory, dedicado a Coco Chanel, repasa su vida e influencia en cómo concebimos el estilo hasta el día de hoy.

