{'pk': 17929040605215431, 'user_id': 4083812226, 'text': 'Algunas fotos de la muestra "Ovidio. Amori, miti e altre storie" que se exhibe en la Scuderie del Quirinale en Roma hasta enero del año que viene.
La primera es el manuscrito decorado de la Metamorfosis más antiguo que se conoce (producido en Bari entre los siglos XI-XII). Las demás son (en orden) ediciones de las Heroidas, la Metamorfosis, las Tristes y Epistolae Ex Ponto, y de Fastos.

