{'pk': 17955518107091942, 'user_id': 4083812226, 'text': 'Valerie Steele, doctora en Historia y directora del Museo del Fashion Institute of Technology, es uno de los referentes que ayudó a establecer los Estudios de Moda como un campo académico legítimo.
