{'pk': 17919953677190118, 'user_id': 4083812226, 'text': 'Dice Alan Pauls sobre la lectura, su vicio impune: “Leyó en camas, en sótanos, en colectivos, en aviones, caminando por la calle. Leyó de pie, acostado, sentado, al sol, desnudo, abrigado hasta los dientes, dormido. Leyó en bibliotecas, cocinas, salas de espera, habitaciones de hospitales, altillos, pasillos, baños. Leyó en trenes, colectivos, vagones de subte, taximotos; a toda velocidad, a caballo, tan despacio que le parecía estar desleyendo lo que leía. Leyó recordándolo todo, olvidándolo todo, imaginando todas y cada una de las cosas que leía. Leyó solo, acompañado, velando a un amigo muerto, en grupo. Leyó con miedo, desconcertado, riéndose a carcajadas, incrédulo, fuera de sí, maravillado, impasible. 
Nada de lo que ha hecho en la vida ha aceptado adoptar formas tan diversas. Leer, para él, es la experiencia mínima, modesta, económica, alrededor de la cual se despliega la multiplicidad del mundo”. Hoy salió el sol y nosotros lo festejamos de la mejor manera: leyendo afuera 🍃

